INSERT INTO `pages` (`id`, `section`, `name`, `text`, `title`, `description`, `keywords`) VALUES
(1, 1, 'Подбор продукции', '<iframe src="http://rowe-mineraloel.lubricantadvisor.com/default.aspx?lang=rus&amp;p=0" width="840" height="1200" frameborder="0" marginwidth="0" marginheight="0" align="left"></iframe>', 'Подбор продукции', 'Подбор продукции', 'Подбор продукции'),
(2, 2, 'Сертификаты', '<br>', 'Сертификаты', 'Сертификаты', 'Сертификаты'),
(3, 3, 'Оплата и доставка', 'Только безналичная форма оплаты.<br><br>Общая система налогообложения включает НДС.<br><br>Отправка в любой регион России.<br><br>Доставка до транспортной компании.<br><br> Самовывоз.', 'Оплата и доставка', 'Оплата и доставка', 'Оплата и доставка'),
(4, 4, 'Контакты', '<p>г.Москва. Первый киллометр по Киевскому шоссе.</p> <p>Рынок ТК «Автомастер».</p> <p>Павилион Г20</p><p>Телефон: &nbsp;+7(495)979-69-36</p><p>Email : info@autozipp.ru</p><p>Skype : &nbsp;e-ssen1</p>', 'Контакты', 'Контакты', 'Контакты'),
(5, 5, 'Официальный поставщик масла ROWE', '<p style="margin-bottom: 0px; padding: 0px; border: 0px; font-stretch: inherit; vertical-align: baseline;">ROWE MINERALÖLWERK GMBH была основана в феврале 1995г в Флерсхайме-Дальсхайме. Благодаря успешной политики предприятия, выбранной генеральным директором и учредителем г-ном Михаелем Цее, компания быстро выросла и переехала в начале 2000 года в Бубенхайм.</p><p style="margin-bottom: 0px; padding: 0px; border: 0px; font-stretch: inherit; vertical-align: baseline;">Высокое качество продукции, короткие сроки поставки и привлекательные цены позволили компании пройти сертификацию по стандартам DIN EN ISO 9001:2008, ISO/TS 16949:2009 и ISO 14001 и стать признанным партнером крупных фирм в Германии и по всему миру. Южная и Восточная Европа, Ближний Восток, Азия и Южная Америка – главные рынки экспорта нашей продукции.</p><p style="margin-bottom: 0px; padding: 0px; border: 0px; font-stretch: inherit; vertical-align: baseline;">Менеджмент качества продукции осуществляется в масштабе целой компании ROWE MINERALÖLWERK GMBH. Подробное описание производственных процессов и их стадий обеспечивают одинаково высокое качество продукции. Постоянный и тесный контакт с клиентами помогает нам быстро реагировать и устранять возникающие слабые места.</p><p style="margin-bottom: 0px; padding: 0px; border: 0px; font-stretch: inherit; vertical-align: baseline;">В декабре 2013 года компания ROWE переехала в Вормс. 32 емкости для смешивания и 6 ультрасовременных установок для розлива делают завод на 82 тыс. кв.м территории (что соответствует 11 футбольным полям) одним из самых больших и современных заводов по производству смазочных материалов в Европе.</p>', 'Официальный поставщик масла ROWE', 'Официальный поставщик масла ROWE', 'Официальный поставщик масла ROWE'),
(6, 6, 'Корзина', 'Корзина', 'Корзина', 'Корзина', 'Корзина'),
(7, 7, 'Рекомендации', '<p>Предписания по замене масла и все необходимые таблицы для скачивания и печати.</p> <p><br></p> <p><span style="color: rgb(156, 156, 148);">Таблица для легковых автомобилей</span><br></p> <p><a href="http://autozipp.ru/files/files1.pdf" target="_blank"><img src="http://autozipp.ru/images/referens/1.jpg" style="width: 100%;"><br>скачать</a></p> <p><br></p> <p><span style="color: rgb(156, 156, 148);">Информационная таблица для коммерческих транспортных средств и смешанных автопарков</span><br></p> <p><a href="http://autozipp.ru/files/files2.pdf" target="_blank"><img src="http://autozipp.ru/images/referens/2.jpg" style="width: 100%;"><br>скачать</a></p> <p><br></p> <p><span style="color: rgb(156, 156, 148);">Информационная таблица для высокотехнологичных автоматических трансмиссионных жидкостей (АТФ) и рулевого трансмиссионных масел</span><br></p> <p><a href="http://autozipp.ru/files/files3.pdf" target="_blank"><img src="http://autozipp.ru/images/referens/3.jpg" style="width: 100%;"><br>скачать</a></p>', 'Рекомендации по замене масла', 'Предписания по замене масла и все необходимые таблицы для скачивания и печати.', 'рекомендации по замене масла ROWE');
