(848, 5, 'Жидкость антиобледенительная ROWE HIGHTEC SCREEN DEFROSTER', '21110-061-03', 'ROWE', '', '', '0,5L', 3, '1.93', '<h1 style="margin-top: 10px; margin-bottom: 0px;">HIGHTEC SCREEN DEFROSTER</h1><div id="text-default"><p style="margin-top: 20px; margin-bottom: 20px;">Спрей против обледенения освобождает оконные стёкла мгновенно от льда и предотвращает новое образование льда.</p></div><p style="margin-top: 20px; margin-bottom: 20px;">Артикул №:&nbsp;21110</p>', 'a:2:{i:0;s:3:"849";i:1;s:3:"850";}', 'a:1:{s:37:"Страна изготовления";s:16:"Германия";}', 'Жидкость антиобледенительная ROWE HIGHTEC SCREEN DEFROSTER', 'Жидкость антиобледенительная ROWE HIGHTEC SCREEN DEFROSTER', 'Жидкость антиобледенительная ROWE HIGHTEC SCREEN DEFROSTER', 'photo/5654ded166e77.jpg', 'Жидкость антиобледенительная ROWE HIGHTEC SCREEN DEFROSTER', 'Жидкость антиобледенительная ROWE HIGHTEC SCREEN DEFROSTER', 848, 0, 0),
(849, 5, 'Очиститель двигателя ROWE HIGHTEC MOTOR-KALTREINIGER', '21152-061-03', 'ROWE', '', '', '0,5L', 1, '2.46', '<h1 style="margin-top: 10px; margin-bottom: 0px;">HIGHTEC MOTOR-KALTREINIGER</h1><div id="text-default"><p style="margin-top: 20px; margin-bottom: 20px;">Высокоэффективный очиститель для удаления масляных и жирных загрязнений из двигателей, автомобилей и машин.</p></div><p style="margin-top: 20px; margin-bottom: 20px;">Артикул №:&nbsp;21152</p>', 'a:2:{i:0;s:3:"848";i:1;s:3:"850";}', 'a:1:{s:37:"Страна изготовления";s:16:"Германия";}', 'Очиститель двигателя ROWE HIGHTEC MOTOR-KALTREINIGER (0,5 л), шт', 'Очиститель двигателя ROWE HIGHTEC MOTOR-KALTREINIGER (0,5 л), шт', 'Очиститель двигателя ROWE HIGHTEC MOTOR-KALTREINIGER (0,5 л), шт', 'photo/5654e09d6d41e.jpg', 'Очиститель двигателя ROWE HIGHTEC MOTOR-KALTREINIGER (0,5 л), шт', 'Очиститель двигателя ROWE HIGHTEC MOTOR-KALTREINIGER (0,5 л), шт', 849, 0, 0),
(850, 5, 'Очиститель колесных дисков ROWE HIGHTEC FELGENREINIGER', '21150-061-03', 'ROWE', '', '', '0.5L', 32, '2.70', '<h1 style="margin-top: 10px; margin-bottom: 0px;">HIGHTEC FELGENREINIGER</h1><div id="text-default"><p style="margin-top: 20px; margin-bottom: 20px;">Высококачественное средство для регулярной очистки колёсных дисков и ухода за ними. Предусмотрено для всех видов стальных, алюминиевых и хромированных колёсных дисков. Особенно бережно очищает, поскольку средство бескислотное и самоактивирующееся. Не разъедает лак и другие чувствительные материалы в области колеса. Самостоятельно удаляет стойкие загрязнения на тормозах и дорожные загрязнения.</p></div><p style="margin-top: 20px; margin-bottom: 20px;">Артикул №:&nbsp;21150</p>', 'a:2:{i:0;s:3:"848";i:1;s:3:"849";}', 'a:1:{s:37:"Страна изготовления";s:16:"Германия";}', 'Очиститель колесных дисков ROWE HIGHTEC FELGENREINIGER (0,5 л), шт', 'Очиститель колесных дисков ROWE HIGHTEC FELGENREINIGER (0,5 л), шт', 'Очиститель колесных дисков ROWE HIGHTEC FELGENREINIGER (0,5 л), шт', 'photo/5654e1e88100e.jpg', 'Очиститель колесных дисков ROWE HIGHTEC FELGENREINIGER (0,5 л), шт', 'Очиститель колесных дисков ROWE HIGHTEC FELGENREINIGER (0,5 л), шт', 850, 0, 0),
(851, 5, 'Очиститель тормозов ROWE HIGHTEC Bremsenreiniger', '21154-055-03', 'ROWE', '', '', '0,5L', 28, '2.03', '<h1 style="margin-top: 10px; margin-bottom: 0px;">HIGHTEC BREMSENREINIGER</h1><div id="text-default"><p style="margin-top: 20px; margin-bottom: 20px;">Этот продукт является безостаточной улетучивающейся очистительной смесью с высокой растворимостью для масел, консистентных смазок и других загрязнений.</p></div><p style="margin-top: 20px; margin-bottom: 20px;">Артикул №:&nbsp;21154</p>', '', 'a:1:{s:37:"Страна изготовления";s:16:"Германия";}', 'Очиститель тормозов ROWE HIGHTEC Bremsenreiniger (0,5 л), шт', 'Очиститель тормозов ROWE HIGHTEC Bremsenreiniger (0,5 л), шт', 'Очиститель тормозов ROWE HIGHTEC Bremsenreiniger (0,5 л), шт', 'photo/5654e2c6dd72b.jpg', 'Очиститель тормозов ROWE HIGHTEC Bremsenreiniger (0,5 л), шт', 'Очиститель тормозов ROWE HIGHTEC Bremsenreiniger (0,5 л), шт', 851, 0, 0),
(852, 15, 'HIGHTEC MULTI SYNT DPF SAE 5W-30 Масло моторное', '20125-0010-03', 'ROWE', '5W-30', 'Малозольное, Синтетика', '1L', 6, '6.16', 'Моторное масло премиум»-класса для рационализации на основе технологии НС синтеза для современных бензиновых и дизельных двигателей с наддувом и без наддува, включая сажевые фильтры (ACEA C3). Использование высококачественного сырья придает этому продукту высшего класса его высокий уровень производительности. HIGHTEC-технология: сильно снижает износ двигателя и расход топлива', '', 'a:1:{s:37:"Страна изготовления";s:16:"Германия";}', 'HIGHTEC MULTI SYNT DPF SAE 5W-30 Масло моторное', 'HIGHTEC MULTI SYNT DPF SAE 5W-30 Масло моторное', 'HIGHTEC MULTI SYNT DPF SAE 5W-30 Масло моторное', 'photo/5654e3924a207.jpg', 'HIGHTEC MULTI SYNT DPF SAE 5W-30 Масло моторное', 'HIGHTEC MULTI SYNT DPF SAE 5W-30 Масло моторное', 139, 0, 0),
(853, 15, 'HIGHTEC SUPER LEICHTLAUF SAE 10W-40 HC-O', '20058-0050-03', 'ROWE', '10W-40', 'Синтетика', '5L', 508, '14.80', '<p>Современное легкотекучее многоцелевое моторное масло на основе НС синтеза для бензиновых и дизельных двигателей легковых автомобилей с наддувом и без наддува. HIGHTEC-технология: снижает износ двигателя и расход топлива.<br></p><p><br></p><p>Всесезонное моторное масло создано на основе специально разработанной технологии гидрокрекинга вязкости класса SAE10W-40. Поэтому оно отлично подходит для использования, как для дизельных, так и для бензиновых двигателей с турбонаддувом или же без него. К тому же оно способно эффективно работать как в холодное время года, так и при экстремальных нагрузках.<br>Leichtlauf SAE 10W-40 – основные преимущества:<br>- соответствие стандартам ЕС;<br>- работа с дизельными и бензинными двигателями;<br>- возможность эффективной работы даже с двигателями с турбонаддувом;<br>- недопущение коксования, лакообразования и слипания;<br>- экономный расход масла и топлива;<br>- защита от коррозии и чёрных отложений;<br>- обеспечение быстрого смазывания всех деталей двигателя;<br>- работа на холодном ходу;<br>- работа во время экстремальных нагрузок;<br>- смешивание с другими маслами – обычных синтетических масел и масел от фирменных производителей;</p>', '', 'a:1:{s:37:"Страна изготовления";s:16:"Германия";}', 'HIGHTEC SUPER LEICHTLAUF SAE 10W-40 HC-O Масло моторное', 'HIGHTEC SUPER LEICHTLAUF SAE 10W-40 HC-O Масло моторное', 'HIGHTEC SUPER LEICHTLAUF SAE 10W-40 HC-O Масло моторное', 'photo/5654e542e760b.jpg', 'HIGHTEC SUPER LEICHTLAUF SAE 10W-40 HC-O Масло моторное', 'HIGHTEC SUPER LEICHTLAUF SAE 10W-40 HC-O Масло моторное', 140, 1, 1),
(854, 15, 'HIGHTEC SYNT RS SAE 5W-30 HC', '20024-173-03', 'ROWE', '5W-30', 'Синтетика', '1L', 22, '4.56', '<p>Легкотекучее многоцелевое моторное масло премиум» на основе НС синтеза специально разработанное для двигателей FORD. HIGHTEC-технология: снижает износ двигателя и расход топлива.</p><p><br></p>HC синтетическое масло – это масло премиум класса разработанное на основе лучших сортов базовых масел, созданных благодаря НС-синтезу.<br>Эффективность масла заключается в том, что оно рационально расходуется, но и значительно экономит топливо.<br>Данная модель моторного масла разработана с учётом требований автомобилей модели FORD дизельного или бензинового характера. Но стоит отметить то, что мало применяется исключительно для моторов по ACEA A1/B1-04.<br>Моторные масла премиум класса – основные преимущества:<br>- соответствие всем необходимым нормам ЕС;<br>- работа даже при холодном старте;<br>- быстрое промасливание деталей мотора;<br>- работа даже при низких температурных показателях;<br>- экономия расхода масла и топлива;<br>- эффективность работы при экстремальных нагрузках;<br>- защита от окисления и чёрного осадка;<br>- предотвращение возникновения склеивания, закоксовывания деталей (клапанов, цилиндров, гильз и турбонагревателей) и лакообразования;<br>- совмещение с обычными маслами и маслами от мировых фирменных производителей;<br>- эффективность функции гидравлического толкателя;<br>Приобрести моторное масло вы можете уже сейчас, заполнив специальный бланк заказа или связаться с нашим продавцом консультантом.', '', 'a:1:{s:37:"Страна изготовления";s:16:"Германия";}', 'Масло моторное HIGHTEC SYNT RS SAE 5W-30 HC (1 л), шт', 'Масло моторное HIGHTEC SYNT RS SAE 5W-30 HC (1 л), шт', 'Масло моторное HIGHTEC SYNT RS SAE 5W-30 HC (1 л), шт', 'photo/5654e62572105.jpg', 'Масло моторное HIGHTEC SYNT RS SAE 5W-30 HC (1 л), шт', 'Масло моторное HIGHTEC SYNT RS SAE 5W-30 HC (1 л), шт', 141, 0, 0),
(855, 22, 'Защитные присадки HIGHTEC DIESEL SYSTEM PROTECT', '22205-025-03', 'ROWE', '', '', '0,25', 14, '2.46', '<h1 style="margin-top: 10px; margin-bottom: 0px;">HIGHTEC DIESEL SYSTEM PROTECT</h1><div id="text-default"><p style="margin-top: 20px; margin-bottom: 20px;">Защита для дизельных систем.</p></div><p style="margin-top: 20px; margin-bottom: 20px;">Артикул №:&nbsp;22205</p>', '', 'a:1:{s:37:"Страна изготовления";s:16:"Германия";}', 'Защитные присадки к нефтепродуктам HIGHTEC DIESEL SYSTEM PROTECT (250 мл), шт', 'Защитные присадки к нефтепродуктам HIGHTEC DIESEL SYSTEM PROTECT (250 мл), шт', 'Защитные присадки к нефтепродуктам HIGHTEC DIESEL SYSTEM PROTECT (250 мл), шт', 'photo/5654e6e627725.jpg', 'Защитные присадки к нефтепродуктам HIGHTEC DIESEL SYSTEM PROTECT (250 мл), шт', 'Защитные присадки к нефтепродуктам HIGHTEC DIESEL SYSTEM PROTECT (250 мл), шт', 855, 0, 0),
(856, 22, 'Очищающие присадки HIGHTEC INJECTION CLEANER', '22202-030-03', 'ROWE', '', '', '0,3L', 18, '2.54', 'Очиститель системы впрыска для бензиновых двигателей.', '', 'a:1:{s:37:"Страна изготовления";s:16:"Германия";}', 'Очищающие присадки к нефтепродуктам HIGHTEC INJECTION CLEANER (300 мл), шт', 'Очищающие присадки к нефтепродуктам HIGHTEC INJECTION CLEANER (300 мл), шт', 'Очищающие присадки к нефтепродуктам HIGHTEC INJECTION CLEANER (300 мл), шт', 'photo/5654e83176c92.jpg', 'Очищающие присадки к нефтепродуктам HIGHTEC INJECTION CLEANER (300 мл), шт', 'Очищающие присадки к нефтепродуктам HIGHTEC INJECTION CLEANER (300 мл), шт', 856, 0, 0),
(857, 22, 'Присадка для устранения течи', '22008-006-03', 'ROWE', '', '', '0.25L', 3, '3.36', 'Герметик. Мгновенно и надёжно уплотняет и устраняет течи радиаторов системы охлаждения на длительный срок<span style="color: rgb(34, 34, 34); font-family: ''Open Sans'', Arial, sans-serif; font-size: 12px; line-height: 21px; background-color: rgb(253, 253, 253);">.</span>', '', 'a:1:{s:37:"Страна изготовления";s:16:"Германия";}', 'Присадка для устранения течи в радиаторах HIGHTEC Kühlerdicht (250 мл), шт', 'Присадка для устранения течи в радиаторах HIGHTEC Kühlerdicht (250 мл), шт', 'Присадка для устранения течи в радиаторах HIGHTEC Kühlerdicht (250 мл), шт', 'photo/5654e8aacd2c8.jpg', 'Присадка для устранения течи в радиаторах HIGHTEC Kühlerdicht (250 мл), шт', 'Присадка для устранения течи в радиаторах HIGHTEC Kühlerdicht (250 мл), шт', 857, 0, 0),
(858, 22, 'Присадки для восстановления сальников', '22006-006-03', 'ROWE', '', '', '0.25L', 9, '5.73', '<p>Присадки для восстановления сальников и уплотнителей HIGHTEC Öl-Leck-Stop (250 мл), шт</p><p>Присадка в моторное масло. Надёжно уплотняет негерметичные прокладки и уплотнительные кольца. Прокладки станут снова эластичными и ухоженными на протяжении длительного срока. Безвредно для окружающей среды.<br></p>', '', 'a:1:{s:37:"Страна изготовления";s:16:"Германия";}', 'Присадки для восстановления сальников и уплотнителей HIGHTEC Öl-Leck-Stop (250 мл), шт', 'Присадки для восстановления сальников и уплотнителей HIGHTEC Öl-Leck-Stop (250 мл), шт', 'Присадки для восстановления сальников и уплотнителей HIGHTEC Öl-Leck-Stop (250 мл), шт', 'photo/5654e94090425.jpg', 'Присадки для восстановления сальников и уплотнителей HIGHTEC Öl-Leck-Stop (250 мл), шт', 'Присадки для восстановления сальников и уплотнителей HIGHTEC Öl-Leck-Stop (250 мл), шт', 858, 0, 0),
