(862, 3, 'Тормозная жидкость HIGHTEC Brake Fluid DOT 4 250 мл , шт', '25101-0036-03', 'ROWE', '', '', '0.25L', 20, '1.79', '<h1 style="margin-top: 10px; margin-bottom: 0px;">HIGHTEC BRAKE FLUID DOT 4</h1><div id="text-default"><p style="margin-top: 20px; margin-bottom: 20px;">Синтетическая высокопроизводительная тормозная жидкость на гликоленовой основе с ингибиторами окисления и коррозии для гидравлических тормозных систем и систем сцепления согласно предписаниям производителя. Эта тормозная жидкость смешиваема с любой синтетической тормозной жидкостью<span style="color: rgb(34, 34, 34); font-family: ''Open Sans'', Arial, sans-serif; font-size: 12px; line-height: 21px; background-color: rgb(253, 253, 253);">.</span></p></div>', '', 'a:1:{s:37:"Страна изготовления";s:16:"Германия";}', 'Тормозная жидкость HIGHTEC Brake Fluid DOT 4 250 мл , шт', 'Тормозная жидкость HIGHTEC Brake Fluid DOT 4 250 мл , шт', 'Тормозная жидкость HIGHTEC Brake Fluid DOT 4 250 мл , шт', 'photo/5654ec94ca514.jpg', 'Тормозная жидкость HIGHTEC Brake Fluid DOT 4 250 мл , шт', 'Тормозная жидкость HIGHTEC Brake Fluid DOT 4 250 мл , шт', 862, 0, 0),
(863, 9, 'Масло трансмиссионное HIGHTEC HYPOID EP 75W-140 S-LS (5 л), шт', '25029-548-03', 'ROWE', '75W-140', '', '5L', 48, '36.17', '<h1>Масло трансмиссионное HIGHTEC HYPOID EP 75W-140 S-LS (5 л), шт</h1><p>Синтетическое высокопроизводительное всесезонное гипоидное масло для осевых передач и раздаточных коробок, имеющими дифференциал с блокировкой и без него, согласно предписаниям производителя.</p>', '', 'a:1:{s:37:"Страна изготовления";s:16:"Германия";}', 'Масло трансмиссионное HIGHTEC HYPOID EP 75W-140 S-LS (5 л), шт', 'Масло трансмиссионное HIGHTEC HYPOID EP 75W-140 S-LS (5 л), шт', 'Масло трансмиссионное HIGHTEC HYPOID EP 75W-140 S-LS (5 л), шт', 'photo/5654ed802cdd3.jpg', 'Масло трансмиссионное HIGHTEC HYPOID EP 75W-140 S-LS (5 л), шт', 'Масло трансмиссионное HIGHTEC HYPOID EP 75W-140 S-LS (5 л), шт', 863, 0, 0);
